import React from 'react';

const Power = ({ data }) => {
    return (
      <table className="table table-striped table-bordered table-hover">
        <thead>
          <tr>
            <th>Current Load</th>
            <th>Capacity</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td>{item.currentLoad}</td>
              <td>{item.capacity}</td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  };

  export default Power;
